import React, { useState } from "react";

const Index = () => {
  const [count, setCount] = useState(0);
  const styling = {
    width: "100px",
    heigth: "25px",
    borderRadius: "2px solid red",
    background: "yellow",
  };
  return (
    <>
      <h1>Hello world</h1>
      <button style={styling}>+</button>
      <button style={styling}>0</button>
      <button style={styling}>-</button>
    </>
  );
};
export default Index;
